DROP TABLE IF EXISTS `xb_renzen_cards`;
CREATE TABLE `xb_renzen_cards` (
  `ID` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `UserID` int(11) NOT NULL COMMENT '会员ID',
  `TaskID` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '淘宝认证',
  `CardFace` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '身份证正面',
  `CardSide` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '身份证反面',
  `Cardschi` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '手持身份证',
  `Birthday` datetime DEFAULT NULL COMMENT '出生日期',
  `Yddatas` longtext COLLATE utf8_bin COMMENT '有盾数据',
  `Status` tinyint(4) DEFAULT '0' COMMENT '状态:0待审核 1已认证 2认证失败',
  `RenzTime` datetime DEFAULT NULL COMMENT '认证时间',
  `RenzResult` longtext COLLATE utf8_bin COMMENT '认证反回结果',
  `IsDel` tinyint(4) unsigned DEFAULT '0' COMMENT '逻辑删除标记  0未删除 1已删除',
  `OperatorID` int(11) DEFAULT NULL COMMENT '操作者ID',
  `UpdateTime` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`ID`),
  KEY `Status` (`Status`),
  KEY `UserID` (`UserID`),
  KEY `IsDel` (`IsDel`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='身份证认证表';

